import React from "react";

import styled from "styled-components";

const ImgBlock = styled.section`
`;

const ImageBlock = () => {
  return (
    <ImgBlock className="grid grid-cols-3 grid-rows-2 grid-flow-col gap-4">
      <div className="all_tshirts row-span-2"></div>
      <div className="tshirts_black">
        <img src="./assets/tshirts.jpeg" alt="tshirts_all" />
      </div>
      <div className="tshrits_gray">
        <img src="./assets/tshirts.jpeg" alt="tshirts_all" />
      </div>
      <div className="tshirts_white row-span-2">
        <img src="./assets/tshirts.jpeg" alt="tshirts_all" />
      </div>
    </ImgBlock>
  );
};

export default ImageBlock;
